// App.js or Router.js (example using React Router)
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './pages/LoginPage';  // Make sure to import the LoginPage
import RegisterPage from './pages/RegisterPage';  // Import the RegisterPage
import Dashboard from './pages/Dashboard';  // Your other pages/components
import './common.css';

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Define routes for the pages */}
        <Route path="/" element={<LoginPage />} />
          <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        {/* Add any other routes here */}
      </Routes>
    </Router>
  );
};

export default App;
